import Carousel from "react-bootstrap/Carousel";

function Animation() {
  return (
    <Carousel>
      <Carousel.Item interval={1000}>
        <img className="d-block w-30" src="/weather1.jpg" alt="First slide" />
        <Carousel.Caption></Carousel.Caption>
      </Carousel.Item>
      <Carousel.Item interval={1000}>
        <img className="d-block w-100" src="/weather2.JPG" alt="Second slide" />
        <Carousel.Caption></Carousel.Caption>
      </Carousel.Item>
      <Carousel.Item>
        <img className="d-block w-100" src="/weather3.JPG" alt="Third slide" />
        <Carousel.Caption></Carousel.Caption>
      </Carousel.Item>
    </Carousel>
  );
}

export default Animation;
